          "id": "9a2956bd44bfec78ec3e7f0bcecc74b1454eadf6",
          "message": "ZKVM-1071: Bring v2 profiler in-line with v1 capabilities (#2829)\n\nThis hooks up the v2 executor with the guest profiling, and implements\r\nthe paging events.\r\n\r\nThis converts the v2 `TraceEvents` to the v1 `TraceEvents` that the\r\nprofiler expects. The v1 and v2 `TraceEvents` are identical though, and\r\nwhen we go to delete v1 we can just swap out the profiler's `TraceEvent`\r\nwith the v2 one and remove the conversion.\r\n\r\nI ran the `execute` benchmark from the datasheet on v2 before and after\r\nthese changes to confirm that there was no regression.\r\n\r\nHere is a sample of the guest profile running on v2 with the paging\r\nevents\r\n<img width=\"1579\" alt=\"Screenshot 2025-02-13 at 2 17 38â€¯PM\"\r\nsrc=\"https://github.com/user-attachments/assets/b8f83083-b640-4acc-ac11-409e80ae7daa\"\r\n/>",
